import React from "react"
class App extends React.Component{
    constructor(){
        super();
        this.state={
            fanme:"",
            email:"",
            password:"",
            cpassword:""

        }
    }
    handleFname=(e)=>{
        this.setState({fanme:e.target.value})
    }
    handleEmail=(e)=>{
        this.setState({email:e.target.value})
    }
    handlePassword=(e)=>{
        this.setState({password:e.target.value})
    }
    handleCpassword=(e)=>{
        this.setState({Cpassword:e.target.value})
    }

    handleSubmit=()=>{
        if(this.state.fname.length<6){
            alert("enter the value atlest > 6 character")
        }
        else if(this.state.password !== this.state.cpassword){
            alert("password does not match")
        }
        else{
            alert("from sucessfuly")
        }

    }


    render(){
        return(
          <div>
            <form  onSubmit={this.handleSubmit}>
                <label>fname:</label>
                <input  value={this.state.fname} type="text" placeholder="enter value" required onChange={this.handleFname}></input>
                <br/>
                <label>email:</label>
                <input type="email" placeholder="emial"  required onChange={this.handleEmail}></input>
                <br/>
                <label>password:</label>
                <input type="password" placeholder="password" required onChange={this.handlePassword}></input>
                <br/>
                <label>cpassword:</label>
                <input type="cpassword" placeholder="cpassword" required onChange={this.handleCpassword}></input>
                <br/>
                <button>submitd</button>
            </form>
          </div>
        )
        
    }
}
export default App;
